import './../style/main.css';
import './../style/font-awesome.min.css'
import './../style/traduler.css';
import {useEffect} from "react";


function Header(){
    (function($) {


        $(function() {

            var	$window = $(window),
                $body = $('body');

            // Disable animations/transitions until the page has loaded.
            $body.addClass('is-loading');

            $window.on('load', function() {
                window.setTimeout(function() {
                    $body.removeClass('is-loading');
                }, 100);
            });

            // Touch?
            if (skel.vars.mobile)
                $body.addClass('is-touch');

            // Forms.
            var $form = $('form');

            // Auto-resizing textareas.
            $form.find('textarea').each(function() {

                var $this = $(this),
                    $wrapper = $('<div class="textarea-wrapper"></div>'),
                    $submits = $this.find('input[type="submit"]');

                $this
                    .wrap($wrapper)
                    .attr('rows', 1)
                    .css('overflow', 'hidden')
                    .css('resize', 'none')
                    .on('keydown', function(event) {

                        if (event.keyCode == 13
                            &&	event.ctrlKey) {

                            event.preventDefault();
                            event.stopPropagation();

                            $(this).blur();

                        }

                    })
                    .on('blur focus', function() {
                        $this.val($.trim($this.val()));
                    })
                    .on('input blur focus --init', function() {

                        $wrapper
                            .css('height', $this.height());

                        $this
                            .css('height', 'auto')
                            .css('height', $this.prop('scrollHeight') + 'px');

                    })
                    .on('keyup', function(event) {

                        if (event.keyCode == 9)
                            $this
                                .select();

                    })
                    .triggerHandler('--init');

                // Fix.
                if (skel.vars.browser == 'ie'
                    ||	skel.vars.mobile)
                    $this
                        .css('max-height', '10em')
                        .css('overflow-y', 'auto');

            });

            // Fix: Placeholder polyfill.
            $form.placeholder();

            // Prioritize "important" elements on medium.
            skel.on('+medium -medium', function() {
                $.prioritize(
                    '.important\\28 medium\\29',
                    skel.breakpoint('medium').active
                );
            });

            // Menu.
            var $menu = $('#menu');

            $menu.wrapInner('<div class="inner"></div>');

            $menu._locked = false;

            $menu._lock = function() {

                if ($menu._locked)
                    return false;

                $menu._locked = true;

                window.setTimeout(function() {
                    $menu._locked = false;
                }, 350);

                return true;

            };

            $menu._show = function() {

                if ($menu._lock())
                    $body.addClass('is-menu-visible');

            };

            $menu._hide = function() {

                if ($menu._lock())
                    $body.removeClass('is-menu-visible');

            };

            $menu._toggle = function() {

                if ($menu._lock())
                    $body.toggleClass('is-menu-visible');

            };

            $menu
                .appendTo($body)
                .on('click', function(event) {
                    event.stopPropagation();
                })
                .on('click', 'a', function(event) {

                    var href = $(this).attr('href');

                    event.preventDefault();
                    event.stopPropagation();

                    // Hide.
                    $menu._hide();

                    // Redirect.
                    if (href == '#menu')
                        return;

                    window.setTimeout(function() {
                        window.location.href = href;
                    }, 350);

                })
                .append('<a class="close" href="#menu">Close</a>');

            $body
                .on('click', 'a[href="#menu"]', function(event) {

                    event.stopPropagation();
                    event.preventDefault();

                    // Toggle.
                    $menu._toggle();

                })
                .on('click', function(event) {

                    // Hide.
                    $menu._hide();

                })
                .on('keydown', function(event) {

                    // Hide on escape.
                    if (event.keyCode == 27)
                        $menu._hide();

                });

        });

    })(jQuery);


    const myList = () => {
    }

    return (
        <div>
            <div className="wrapp">
                <div>
                    <a href="#">
                        <img src="images/traduler-logo-green.png" height="80px"/></a></div>
                <div>
                    <header id="header">
                        <nav>
                            <ul>
                                <li onClick={myList}><a>Menu</a></li>
                            </ul>
                        </nav>
                    </header>
                    <nav id="menu">
                        <h3>유저아이디 : abc</h3>
                        <h2>Menu</h2>
                        <ul>
                            <li><a href="${contextPath }/index">HOME</a></li>
                            <li><a href="#">리뷰 게시판</a></li>
                            <li><a href="#">QnA 게시판</a></li>
                            <li><a href="#">MY PAGE</a></li>
                            {  /*         <c:if test="${adminId != null }">
                                <li><a href="${contextPath }/member/memberInfo">회원 정보</a></li>
                            </c:if>
                                 <c:choose>
                                <c:when test="${userId == null && adminId == null }">
                                    <li><a
                                        href="javascript:loginpopup('${contextPath }/member/loginForm','loginpopup');">로그인</a>
                                    </li>
                                </c:when>
                                <c:otherwise>
                                    <li><a href="${contextPath }/member/logout">로그아웃</a></li>
                                </c:otherwise>
                            </c:choose>

                           */ }

                      {  /*     <c:choose>
                                <c:when test="${userId == null && adminId == null }">
                                    <li><br>
                                        <h2>로그인을 한 후 나만의 리스트를 만들어보세요!</h2>
                                    </li>
                                </c:when>
                                <c:otherwise>
                                    <li><br>
                                        <h2>[나의 여행 리스트 후보]</h2>
                                        <div id="replyList"></div>
                                    </li>
                                </c:otherwise>
                            </c:choose>
                         */}
                        </ul>
                    </nav>
                </div>
            </div>

        </div>
    )
}
export default Header;
